settings.cellContentFunction:
let duration = alarm.endTs - alarm.startTs;
let durationStr = durationString(duration);

return '<button id="al-duration" class="mat-button mat-button-base al-cell-button">' +
            durationStr + 
            '<span class="mat-button-focus-overlay"></span>' +
        '</button>';

function durationString(milliseconds) {

    let translate = ctx.$scope.$injector.get(ctx.servicesMap.get('translate'));

    let seconds = Math.floor(milliseconds / 1000);
    const days = Math.floor(seconds / 86400);
    let hours = Math.floor((seconds % 86400) / 3600);
    let minutes = Math.floor(((seconds % 86400) % 3600) / 60);
    seconds = seconds % 60;
    let timeString = '';
    if (days > 0) {
        timeString += days === 1 ? '1 day' : days + ' days ';
    }
    if (hours > 0) {
      timeString += hours === 1 ? '1 hour ' : hours + ' hours ';
    }
    if (minutes > 0) {
      timeString += minutes + ' min ';
    }
    if (seconds > 0) {
      timeString += seconds + ' sec ';
    }
    return timeString;
}

rowClick.customFunction:
let $injector = widgetContext.$scope.$injector;
let assetService = $injector.get(widgetContext.servicesMap.get('assetService'));

let alarm = additionalParams.alarm;
let targetEntityId = alarm.entityId;

let target = $event.target;

let id = target.id;
if (id) {
    switch (id) {
        case 'al-location':
            findRoom(alarm.Location).subscribe(
                (room) => {
                    if (room) {
                        openStateInPopover(target, 'room_location_details', room.id, room.name, '500px', '400px');
                    }
                }
            );
            break;
    }
}

function openStateInPopover(target, stateId, entityId, entityName, width, height) {
    let descriptor = {
        type: 'openDashboardState',
        targetDashboardStateId: stateId,
        openInPopover: true,
        popoverHideDashboardToolbar: true,
        popoverPreferredPlacement: 'bottom',
        popoverHideOnClickOutside: true,
        popoverWidth: width,
        popoverHeight: height,
        setEntityId: true
    };
    let popoverTrigger = getPopoverTrigger(target);
    widgetContext.actionsApi.handleWidgetAction({target: popoverTrigger}, descriptor, entityId, entityName);
}

function getPopoverTrigger(target) {
    let id = target.id;
    let triggerId = id + '-trigger-'+alarm.id.id;
    let parentTable = $(target).parents('.table-container');
    let popoverTrigger = $('#'+triggerId, parentTable);
    if (!popoverTrigger.length) {
        let parentRow = $(target).parents('mat-row');
        let top = parentRow.position().top + $(target).position().top + parentTable.scrollTop();
        let left = $(target).position().left;
        let width = $(target).width();
        let height = $(target).height();
        popoverTrigger = $('<div id="'+triggerId+'" style="width: '+width+'px; height: '+height+'px; position: absolute; top: '+top+'px; left: '+left+'px; pointer-events: none;"></div>');
        parentTable.append(popoverTrigger);
    }
    return popoverTrigger[0];
}

function findRoom(name) {
    return assetService.getUserAssets(widgetContext.pageLink(10, 0, name), 'AL_Room').pipe(
        widgetContext.rxjs.map((pageData) => {
            let found =  pageData.data.filter((asset) => asset.name === name);
            if (found.length) {
                return found[0]
            } else {
                return null;
            }
        })
    );
}

